import Card from './Card';
export default function Profile() {
    return (
 <Card>
    <h1>Photo</h1>
    <img
    className="avatar"
    src="https://i.imgur.com/OKS67lhm.jpg"
    alt="Aklilu Lemma"
    width={70}
    height={70}/>
    <h1>About</h1>
    <p>Aklilu Lemma was a distinguished Ethiopian scientist
    who discovered a natural treatment to schistosomiasis.
    </p>
    </Card>

    );}
